export const lightTheme = {
  body: "#fafafa",
  text: "#363537",
  toggleBorder: "#030303",
  gradient:
    "linear-gradient(to top, #030303, #0d0d0d, #141414, #1a1a1a, #202020)",
};

export const darkTheme = {
  body: "#333",
  text: "#FAFAFA",
  toggleBorder: "#c4c4c4",
  gradient:
    "linear-gradient(to top, #030303, #3d3d3d, #787878, #b9b9b9, #ffffff)",
};
